                              </p>
                              <div>
                                <a href>Buy Now</a>
                              </div>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                  <a
                    className="carousel-control-prev"
                    href="#carouselExampleIndicators"
                    role="button"
                    data-slide="prev"
                  >
                    <span className="sr-only">Previous</span>
                  </a>
                  <a
                    className="carousel-control-next"
                    href="#carouselExampleIndicators"
                    role="button"
                    data-slide="next"
                  >
                    <span className="sr-only">Next</span>
                  </a>
                </div>
              </section>
            </div>
          </div>
        </div>
      </div>

      <br></br>
      <br></br>
      
      
      <div className="containernew">
        <h1>
          Products
        </h1>
        <br>
        </br>
      <div className="col">
        <div className="row">
          {products.slice(0, 8).map((product, index) => {
            return (
              <div key={index} className="col-3 mb-3 ">
                <Card product={product} />

                <br></br>
                <br></br>
              </div>
            );
          })}
          
        </div>
      </div>
      

      <h2>
        Catagory Products
        <br>
        </br>
        
      </h2>
      <div>
      <div className="row">
        <div className="gallery col-lg-12 col-md-12 col-sm-12 col-xs-12">
          
        </div>
        <div align="center">
          {
           Cat.map((cate,index)=>{
            return(
            <button key={index} onClick={uniqueprod(cate.name)}  className="btn btn-default filter-button">{cate.name}</button>
           )})
          }
          
        </div>
        <br>
        </br>
        <br>
        </br>
        <br />
      </div>
      <div className="col">
        <div className="row">
          {products.map((product, index) => {
            return (
              <div key={index} className="col-3 mb-3 ">
                <Card product={product} />
                
